import React from 'react';

function Header() {
  return (
    <header>
      <h1>Jahanara Israil School & College</h1>
      <nav>
        <ul>
          <li><a href="#routine">Class Routine</a></li>
          <li><a href="#info">School Info</a></li>
          <li><a href="#map">Location</a></li>
          <li><a href="#editor">Web Editor</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
